script: |
  super -f text -I q7035.spq | sort > q7035.out

inputs:
  - name: q7035.spq
    data: |
      SELECT DISTINCT + + ( - cor0.col0 ) * - cor1.col2 AS col2 FROM tab2 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet) AS cor1;
  - name: tab1
  - name: tab2

outputs:
  - name: q7035.out
    data: |
      378
      399
      4212
      4266
      4446
      4503
      672
      7488
      7584
